const api = new XMLHttpRequest ();

let url, datos, validadorDeConsulta;
let participante, documento, tipo;

$( document ).ready(function() {

$("#codImg").val('<img src="URL" alt="texto alternativo" width="valor" height="valor" />');

$("#resultado").focus(function(){ this.select(); });
$("#codImg").focus(function(){ this.select(); });

$( "#generar" ).click(function() { generar (); $("#resultado").focus(); });


$("#pa1").focus(); });

/*--------------------------------------------------------------------------------*/

function generar () {
  let cadenaFinal = "";
  if ( $("#pa1").val() != '' && $("#pregunta").val() != '') {
    cadenaFinal = '<div style="width:800px;margin: auto; border-top: 35px solid #f4df78; border-right: 6px solid #f4df78; border-bottom: 6px solid #f4df78; border-left: 6px solid #f4df78; box-shadow: 3px 3px 5px 3px #999; word-break: break-word;">';
    cadenaFinal += '\n';
    cadenaFinal += '<table border="0" cellpadding="20" style="width:98%">' + '\n';
    cadenaFinal += '<tbody>' + '\n';
    cadenaFinal += '<tr> <td> <div style="padding:1%"; word-break: break-word;>' + '\n';
    cadenaFinal += '<p>' + $("#pa1").val() + '</p>' + '\n';
    if ( $("#pa2").val() != '') { cadenaFinal += '<p>' + $("#pa2").val() + '</p>' + '\n'; }
    if ( $("#pa3").val() != '') { cadenaFinal += '<p>' + $("#pa3").val() + '</p>' + '\n'; }
    if ( $("#pa4").val() != '') { cadenaFinal += '<p>' + $("#pa4").val() + '</p>' + '\n'; }
    if ( $("#pa5").val() != '') { cadenaFinal += '<p>' + $("#pa5").val() + '</p>' + '\n'; }
    cadenaFinal += '</div> </td> </tr>' + '\n';
    cadenaFinal += '<tr> <td> <div style="padding:1%; word-break: break-word;">' + '\n';
    cadenaFinal += '<div style="background: #ee9b8d; padding: 2%; border-radius: 0 80px 60px 0; border-left: 30px solid #f4df78; width: 90%; margin: 1%;">' + '\n';
    cadenaFinal += '<p>' + $("#pregunta").val() + '</p>' + '\n';
    cadenaFinal += '</div> </div> </td> </tr>' + '\n';

    $("#resultado").val(cadenaFinal);
    
  } else { $("#resultado").val("¡ERROR! ¡ES obligatorio completar, al menos el 1er párrafo y la pregunta!"); }
}

function determinarBusqueda () {
  if ($("#documento").val() != "") { verificarCertificadoPDF (); }
  else { $("#resultados").html('¡Ups!, <b>¡no has ingresado documento!</b>'); } 
}

function verificarCertificadoPDF () {
  let idSheets = '1AUcbDog7UDFQcpugq_FoiyV_RPUfv1oDIfEMx0Sccz4';
  let apiKey = 'AIzaSyAVvMA2r0J3skLgWq2g0JX6facQN9BXsXM';
  url = "https://content-sheets.googleapis.com/v4/spreadsheets/" + idSheets + "/values/A:C?access_token="+ apiKey +"&key="+ apiKey;
  api.open('GET',url,true);
  api.send();
  validadorDeConsulta = 0;
  $("#resultados").html("¡Tu petición está siendo procesada!, <b>por favor espera…</b>");
  $("#vDocumento").addClass("disabled");

  api.onreadystatechange = function () {
    if (this.status == 500) { sinResultados (); }
    else if (this.status == 200 && this.readyState == 4) {
      datos = JSON.parse (this.responseText);
      if (datos.values.length != '0') {
        let i = 0;
        while (i <= datos.values.length - 1) {
          if (datos.values[i][0] == $("#documento").val()) {
            validadorDeConsulta = 1;
            documento = datos.values[i][0];            
            participante = datos.values[i][1];
            tipo = datos.values[i][2];
            generarCertificadoPDF (tipo);
            $("#resultados").html("<b>¡Tu certificado ha sido generado!</b>");
            i = datos.values.length;
          }
          i++;
        }
      }
    }
    if (validadorDeConsulta == 0) { sinResultados (); }
    $("#vDocumento").removeClass("disabled"); }

  $("#documento").focus(); }

/*--------------------------------------------------------------------------------*/

function sinResultados () {
  $("#resultados").html('¡Ups!, <b>¡no hay resultados para el documento ingresado!.</b>'); }

function generarCertificadoPDF (tipo) {
  var doc = new jsPDF('l','cm',[21.0, 29.0]);
  let texto = ""; let url64 = "";

  function cen (x) {
    let textWidth = doc.getStringUnitWidth(x) * 
    doc.internal.getFontSize() / doc.internal.scaleFactor;
    return (doc.internal.pageSize.width - textWidth) / 2; 
  }

  doc.setFontSize(22);
  doc.setFont("helvetica");
  doc.setFontType("bold");
  
  // Escala píxeles / cm de 38
  switch(tipo) {
    case "90":
      url64 = "data:image/jpeg;base64,";
      doc.addImage(url64, 'JPEG', 0, 0, 0, 0);
      texto = participante; doc.text(cen(texto), 7, texto);
      texto = 'CI: ' + documento; doc.text(cen(texto), 8, texto);
    break;
    case "120":
      url64 = "data:image/jpeg;base64,";
      doc.addImage(url64, 'JPEG', 0, 0, 0, 0);
      texto = participante; doc.text(cen(texto), 7, texto);
      texto = 'CI: ' + documento; doc.text(cen(texto), 8, texto);      
    break;
  }
  
  doc.save('Certificado - ' + tipo + ', ' + participante + ' (' + documento + ').pdf');
}
